package WrapperClass;

public class UnBoxing {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
      
	 Integer a=10;
	 int b=a.intValue();
	 System.out.println(b);
	 
	 
	 Character ch='A';
	 char c=ch.charValue();
	 System.out.println(c);
	 
	 Double d=22.5;
	 double d1=d.doubleValue();
	 System.out.println(d1);
		
	}

}
